**Frontend (src/App.js)**
```jsx
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('/api/data')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  const handleAddData = () => {
    axios.post('/api/data', { name: 'John Doe', age: 30 })
      .then(response => {
        setData([...data, response.data]);
      })
      .catch(error => {
        console.error(error);
      });
  };

  return (
    <div>
      <h1>Data List</h1>
      <ul>
        {data.map(item => (
          <li key={item._id}>{item.name} ({item.age})</li>
        ))}
      </ul>
      <button onClick={handleAddData}>Add Data</button>
    </div>
  );
}

export default App;
```
