class StackedDrawables: LayerDrawable {
    private var shouldPlaceIcons = true
    private let iconScale: Double = 0.70

    convenience init(layers: [String]) {
        self.init(layers: layers, iconScale: iconScale)
    }

    init(layers: [String], iconScale: Double) {
        super.init(layers: layers)
        self.iconScale = iconScale
    }

    required init?(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    class func fromDeviceTypes(deviceTypes: [String], context: UIViewController) -> StackedDrawables? {
        guard let firstTwo = deviceTypes.prefix(2).toArray() else { return nil }
        if firstTwo.count == 1 { firstTwo.append(firstTwo.first!) }
        let drawableList = firstTwo.map { context.getDrawable($0) }.compactMap { $0 }.reversed().toArray()
        return StackedDrawables(layers: drawableList, iconScale: iconScale)
    }

    override func setNeedsDisplay() {
        super.setNeedsDisplay()
        if shouldPlaceIcons { placeIcons() } else { shouldPlaceIcons = true }
    }

    private func placeIcons() {
        shouldPlaceIcons = false
        let newWidth = bounds.size.width
        let iconsSize = Int(floor(newWidth * iconScale))
        let iconsInset = (newWidth - iconsSize) - 1

        for index in 0..<numberOfLayers {
            setLayerSize(index, iconsSize, iconsSize)
            setLayerGravity(index, .center)
            switch index {
            case 1:
                setLayerInset(index, 0, iconsInset, iconsInset, 0)
            case 0:
                setLayerInset(index, iconsInset, 0, 0, iconsInset)
            default:
                break
            }
        }
        setNeedsDisplay()
    }
}
